/* @jsx mdx */
  import React from 'react'
  import { mdx } from '@mdx-js/react'
  /* @jsx mdx */
import { Props } from 'docz'
import Dashboard from './Dashboard'

const makeShortcode = name => function MDXDefaultShortcode(props) {
  console.warn("Component " + name + " was not imported, exported, or provided by MDXProvider as global scope")
  return <div {...props}/>
};

const layoutProps = {

};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">

    <h1 {...{
      "id": "dashboardjs"
    }}>{`Dashboard.js`}</h1>
    <h2 {...{
      "id": "properties"
    }}>{`Properties`}</h2>
    <Props of={Dashboard} mdxType="Props" />
    <h2 {...{
      "id": "method-descriptions"
    }}>{`Method Descriptions`}</h2>
    <p>{`ComponentWillMount()`}</p>
    <blockquote>
      <p parentName="blockquote">{`Utilizing express, a JSON object is retrieved from an API
call using fetch() and changes the application state.`}</p>
    </blockquote>
    <p>{`ComponentWillUnmount()`}</p>
    <blockquote>
      <p parentName="blockquote">{`This function unmounts by clearing the interval
utilizing clearInterval(), a nodeJS method.`}</p>
    </blockquote>
    <h2 {...{
      "id": "notes"
    }}>{`Notes`}</h2>
    <blockquote>
      <p parentName="blockquote">{`The dashboard is the heart of the application. From here, signed in users can see Pi JSON objects and which components
are activated. Note that the majority of the user interface is implemented with the help of MDB React, refer to
mdbootstrap.com/docs/react for more information.`}</p>
    </blockquote>
    </MDXLayout>;
}

MDXContent.isMDXComponent = true;
